import { createRoot } from 'react-dom/client';
import { useState, useEffect } from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import { Header, Home} from "./components";

const appElement = document.getElementById("app")

const App = () => { 

    const [warehouses, setWarehouses] = useState([]);
    const [items, setItems] = useState([]);

    useEffect(()=> {
        fetchWarehouses();
        fetchItems();
    }, [])

    async function fetchWarehouses() {
        try {
            const response = await fetch(`http://localhost:8282/api/warehouses`);
            const data = await response.json();
            setWarehouses(data)
        } catch(error) {
            console.log(error)
        }
    }

    async function fetchInventory() {
        try {
            const response = await fetch(`http://localhost:8282/api/inventory`);
            const data = await response.json();
            setInventory(data)
        } catch(error) {
            console.log(error)
        }
    }

    async function fetchItems() {
        try {
            const response = await fetch(`http://localhost:8282/api/items`);
            const data = await response.json();
            setItems(data)
        } catch(error) {
            console.log(error)
        }
    }

    async function fetchCategories() {
        try {
            const response = await fetch(`http://localhost:8282/api/categories`);
            const data = await response.json();
            setCategories(data)
        } catch(error) {
            console.log(error)
        }
    }

    return ( 
        <div> 
            <Header/>
            <Home warehouses={warehouses} inventory={inventory} items={items} categories={categories} setInventory={setInventory}/> 
        </div> 
    ) 
}

